import classes from './HomePage.module.css';
import React from 'react';
import VerticalMenu from "../Components/VerticalMenu/VerticalMenu";
import HeaderContent from "../Components/HeaderContent/HeaderContent"; // Import the styles for the new page

function HomePage() {
    return (
        <div className={classes.newPageContainer}>
            <VerticalMenu />
            <HeaderContent patientName="John Doe" clientCode="123456" />
            <div className={classes.pageContent}>
                {/* Add the content of your new page here */}

                {/* ... */}
            </div>
        </div>
    );
}

export default HomePage;
